import { GET_ITEMS } from "./Types";
import Axios from "axios";

export const getItems = () => (dispatch) => {
  Axios.get("/venders?mealType=veg").then((res) =>
    dispatch({
      type: GET_ITEMS,
      payload: res.data,
    })
  );
};
